import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import api from "../api";

// Define the shape of the order details (adjust as needed)
interface OrderDetails {
  _id: string;
  desc: string;
  adress: string;
  createdAt: string;
  updatedAt: string;
  // The file is stored as a subdocument containing a binary array and a MIME type
  file: {
    data: number[]; // the binary data as an array of numbers
    contentType: string;
  };
  from: { _id: string; username: string };
  processing: { _id: string; name: string; desc: string };
  service: {
    _id: string;
    name: string;
    desc: string;
    technology: { _id: string; name: string; desc: string };
    material: { _id: string; name: string; desc: string };
  };
}

// Helper function to convert a numeric array (or array-like) to a Base64 string.
// This uses Uint8Array to interpret the binary data.
const arrayBufferToBase64 = (buffer: any): string => {
  const byteArray = new Uint8Array(buffer);
  let binary = "";
  byteArray.forEach((byte) => (binary += String.fromCharCode(byte)));
  return window.btoa(binary);
};

export default function OrderDetailsPage() {
  // Retrieve the order ID from the route parameters
  const { orderId } = useParams<{ orderId: string }>();
  const [order, setOrder] = useState<OrderDetails | null>(null);

  useEffect(() => {
    async function fetchOrder() {
      try {
        const res = await api.get(`/order/${orderId}`);
        setOrder(res.data);
      } catch (error) {
        console.error("Failed to fetch order details", error);
      }
    }
    fetchOrder();
  }, [orderId]);

  // Helper function to convert an array of numbers to a Base64 string
const arrayBufferToBase64 = (buffer: number[]): string => {
    // Convert array of numbers to a string of characters
    const binaryString = buffer.map((byte) => String.fromCharCode(byte)).join("");
    return window.btoa(binaryString);
  };

  const downloadFile = () => {
    if (order && order.file && order.file.data) {
      // If order.file.data is a Mongoose Binary object, its JSON representation
      // might be an object with a "data" property.
      const binaryData =
        typeof order.file.data === "object" && (order.file.data as any).data
          ? (order.file.data as any).data
          : order.file.data;
      // Convert the binary data (an array of numbers) to a Base64 string
      const base64Str = arrayBufferToBase64(binaryData);
      const dataUrl = `data:${order.file.contentType};base64,${base64Str}`;

      // Create a temporary anchor element to trigger the download
      const link = document.createElement("a");
      link.href = dataUrl;
      link.download = "uploaded_file";
      document.body.appendChild(link);
      link.click();
      document.body.removeChild(link);
    }
  };


  if (!order) return <div>Loading order details...</div>;

  return (
    <div style={{ padding: "1rem" }}>
      <h1>Order Details</h1>
      <p>
        <strong>Description:</strong> {order.desc}
      </p>
      <p>
        <strong>Address:</strong> {order.adress}
      </p>
      <p>
        <strong>Created At:</strong>{" "}
        {new Date(order.createdAt).toLocaleString()}
      </p>
      <p>
        <strong>Updated At:</strong>{" "}
        {new Date(order.updatedAt).toLocaleString()}
      </p>
      <p>
        <strong>Ordered By:</strong> {order.from.username}
      </p>
      <hr />
      <h2>Processing Information</h2>
      <p>
        <strong>Name:</strong> {order.processing.name}
      </p>
      <p>
        <strong>Description:</strong> {order.processing.desc}
      </p>
      <hr />
      <h2>Service Information</h2>
      <p>
        <strong>Service Name:</strong> {order.service.name}
      </p>
      <p>
        <strong>Service Description:</strong> {order.service.desc}
      </p>
      <p>
        <strong>Technology:</strong>{" "}
        {order.service.technology.name} - {order.service.technology.desc}
      </p>
      <p>
        <strong>Material:</strong>{" "}
        {order.service.material.name} - {order.service.material.desc}
      </p>
      <hr />
      <button onClick={downloadFile}>Download Uploaded File</button>
    </div>
  );
}
